    {
        public void Feed(byte b, Charset.Charset.GetCharCallback callback, Charset.Charset.GetCharCallback error)
        {
            if (_first)
            {
                if (b >= 0x80)
                {
                    _first = false;
                    _last_char = b;
                }
                else
                {
                    callback((char)b);
                }
            }
            else
            {
                _first = true;
                if (b >= 0x40)
                {
                    if (GBK_Unicode[_last_char * 0x100 + b - 0x8000] != '\0')
                    {
                        callback(GBK_Unicode[_last_char * 0x100 + b - 0x8000]);
                    }
                    else
                    {
                        if (error != null) error((char)(_last_char * 0x100 + b));
                    }
                }
                else
                {
                    if (error != null) error((char)_last_char);
                    callback((char)b);
                }
            }
        }

        public byte[] GetBytes(string s)
        {
            if (s == null)
                return new byte[0];
            else
            {
                List<byte> code = new List<byte>();
                foreach (char c in s)
                {
                    int i = Unicode_GBK[(int)c];
                    if (i != 0)
                    {
                        if (i >= 256)
                        {
                            code.Add((byte)(i / 256));
                        }
                        code.Add((byte)(i % 256));
                    }
                    else
                    {
                        code.Add(0x3F);
                    }
                }
                return code.ToArray();
            }
        }

